const { useEffect, useState } = require('react');

export default useFetch = (url) => {
  const [data, setData] = useState(null);

  useEffect(() => {
    const getData = async () => {
      const data = await fetchData(url);
      setData(data);
    };
    getData();
  }, []);
  return [data, setData];
};
